import React from 'react'
import {BrowserRouter, Route} from 'react-router-dom'
import {NavigationBar} from "./navbar and bottom/navbar";
import MainPage from "./pages/mainPage";

function App(){
  return(
      <BrowserRouter basename='/sighIn'>
        <NavigationBar/>
        <Route exact path="/">
        <MainPage/>
        </Route>
      </BrowserRouter>
  )
}

export default App;
